''' 438. Find All Anagrams in a String
Medium      9212      285      Add to List      Share

Given two strings s and p, return an array of all the start indices of p's
anagrams in s. You may return the answer in any order.

An Anagram is a word or phrase formed by rearranging the letters of a different
word or phrase, typically using all the original letters exactly once.


Example 1:
Input: s = "cbaebabacd", p = "abc"
Output: [0,6]
Explanation:
The substring with start index = 0 is "cba", which is an anagram of "abc".
The substring with start index = 6 is "bac", which is an anagram of "abc".

Example 2:
Input: s = "abab", p = "ab"
Output: [0,1,2]
Explanation:
The substring with start index = 0 is "ab", which is an anagram of "ab".
The substring with start index = 1 is "ba", which is an anagram of "ab".
The substring with start index = 2 is "ab", which is an anagram of "ab".
 

Constraints:        1 <= s.length, p.length <= 3 * 10^4
                    s and p consist of lowercase English letters.
Accepted:       641,268
Submissions:    1,308,794

'''

from typing import List


class Solution_v2: # T: O(m)    M: O(n)     # m, n = len(s), len(p)
    def findAnagrams(self, s: str, p: str) -> List[int]:
        m, n = len(s), len(p)
        if m < n: return []
        counts, countp, ans = {}, {}, []

        for i in range(n):
            if s[i] in counts: counts[s[i]] += 1
            else: counts[s[i]] = 1

            if p[i] in countp: countp[p[i]] += 1
            else: countp[p[i]] = 1
        if counts == countp: ans.append(0)
        
        for i in range(n, m):
            if s[i] in counts: counts[s[i]] += 1
            else: counts[s[i]] = 1
            
            counts[s[i - n]] -= 1
            if counts[s[i - n]] == 0: del counts[s[i - n]]

            if counts == countp: ans.append(i - n + 1)

        return ans

def main():
    sol = Solution_v2()
    s, p = "cbaebabacd", "abc" # Output: [0,6]
    print(sol.findAnagrams(s, p))

    s, p = "abab", "ab" # Output: [0,1,2]
    print(sol.findAnagrams(s, p))

main()


